import axios from "axios";

export const getEvents = async () => {
  try {
    const data = await axios.get(
      `https://localhost:7010/user/all`,
      {
        headers: {
          "Access-Control-Allow-Origin": "*"
        },
      }
    );

    return data;
  } catch (error) {
    return null;
  }
};
